import "./styles.scss";

const CurrencyData = ({ usd, eur }) => {
  return (
    <div className="container">
      <div className="first-item">usd {usd?.toFixed(2)} грн</div>
      <div className="second-item">eur {eur?.toFixed(2)} грн</div>
    </div>
  );
};

export default CurrencyData;
